import React, { useEffect, useState } from 'react';
import { getFormulaire } from './api'; // assuming you have an api file exporting getFormulaire function

function FormulaireList() {
    const [formulaires, setFormulaires] = useState([]); // defining Formulaires state variable

    useEffect(() => {
        // Fetching formulaires when component mounts
        getFormulaire()
            .then(data => setFormulaires(data))
            .catch(error => console.error('Error fetching formulaires:', error));
    }, []);

    return(
        <>
        <h3> Formulaire</h3>
        <table>
            <thead>
                <td>Nom</td>
                <td>Prenom</td>
                <td>Email</td>
            </thead>
            <tbody>
                {Formulaires.map(formulaire =>{
                return <tr key={formulaire.formulaire_id}>
                <td>{formulaire.nom}</td>
                <td>{formulaire.prenom}</td>
                <td>{formulaire.mail}</td>
                <td><button type="submit">Enoyer</button> </td>
                
            </tr>
                })}
                
            </tbody>
        </table>
        
        </>
    )
    
}
